import React from 'react';
import { View } from 'react-native';
import colors from '../styles/colors'

function Divider () {

  return (
    <View style={{
      height: 1,
      width: '90%',
      backgroundColor: '#DFE2E2',
      alignSelf: 'center'
    }}>
    </View>
  );
}

export default Divider;
